import Header from "../components/header"
import Footer from '../components/footer'

export default function Project(){
    return(
        <div>
            <Header></Header>
            <h3>Project Showcase!</h3>
            <p>Here is where I showcase some of the projects I've worked on/built</p>
            <p>It doesn't only include coding projects but also some projects I've done</p>
            <p>outside of software developing such as drawings and car stuff</p>
            <Footer></Footer>
        </div>
    );
}
